import './Navbar.css';
import { Link } from 'react-router-dom';
import React from 'react';

function Navbar() {
  return(
    React.createElement("header", { className: "navbar" }, 
    React.createElement("div", { className: "navbar__title navbar__item"},<Link to="/">
      <img className="logo" src="webshio.png" alt=""/> 
    </Link>),
    React.createElement("div", { className: "navbar__item"}, "Add Item", <Link to="add-item">
    </Link>), 
    React.createElement("div", { className: "navbar__item"},<Link to="cart"><img className="ca" src="cart.svg" alt=""/>
    </Link>, "Add Category"), 
    React.createElement("div", { className: "navbar__item"},<Link to="cart"><img className="cart" src="cart.svg" alt=""/>
  </Link>,"Cart")
  ))
}


export default Navbar
